import { NavLink } from "react-router-dom";
import './Navbar.css'

export const Navbar = () => {
    return (
        // <nav>
        //     <NavLink to="/">Home</NavLink>
        //     <NavLink to="/about">About</NavLink>
        // </nav>

        <nav class="navbar navbar-light bg-light">
            <a class="navbar-brand" href="#">IOT Dashboard</a>
            <div cid="navbarNav">
                <ul class="navbar-nav">
                    <NavLink to="/">Home</NavLink>
                    <NavLink to="/about">About</NavLink>
                </ul>
            </div>
        </nav>
        
    )
}
